Let&rsquo;s get into a time machine and return to that time. 
Where it was always fun and you were always laughing, to that time...
&quot;I only have three more months to live&quot; 
Yui who just transferred to a new school in the countryside becomes Ryo&rsquo;s classmate. Yui who is suffering from an illness has a &quot;wish&quot; that she can&rsquo;t tell anyone, but Ryo wants to grant her that wish but&hellip;
After death, reality hits Ryo and Yui.
This is the story of the eternal promise that was made by the two of them.

Yuma is having trouble warding off perverts every morning on her way to school. Her classmate Suwa starts going to school with her, in order to protect her, and the two become a couple. However, Yuma is also interested in her biology teacher who rides the same train as her every morning, and&hellip;

The series is composed of coherent episodes that feature different characters.

Kiyoku Yawaku won the 33rd Kodansha Manga Award for shoujo in 2009.

&quot;The person I love is in love with a 2D object-&quot;
Kokoa, a girl with a romance level of zero, likes the most popular boy in her class, Soushi.
However, Soushi is currently a light novel author in high school, and he's a pure, bright, otaku boy...!?

