[spoiler]&quot;Парня, который мне нравится, интересует только 2D...&quot;

Кокоа - девушка, романтики в которой нет ни на йоту, влюблена в самого популярного в классе парня - Соши. Но Соши оказывается не только писателем рассказов, добрым, милым человеком, но и... заядлым отаку?![/spoiler]

When there is darkness in your heart, when you want someone to disappear, he will find you and grant your wish...

Shizuku is used to being the best at everything, but when a transfer student comes to steal her spotlight, she is overcome with jealousy. Hal, a death god, offers her a bargain&ndash;he&rsquo;ll kill three people for her&ndash;and by kill, he means he&rsquo;ll make it so they never existed. All she has to do is say the word.

But when Shizuku gives in to temptation, there will be consequences&hellip;

