description:
The year is 2022. Mankind has finally perfected virtual reality. And within the VRMMORPG (Virtual Reality Massively Multiplayer Online Role Playing Game) Sword Art Online, there was a player called Kirito. While he was enjoying the world of SAO, he and the other 10,000 logged-in players all received a frightening message from the Game Master&mdash;that the only way to escape from that world was to clear the game, and that a game-over within the game would mean their death in the real world.

That was the frightening true story behind this game.

Kirito was one of the first players to accept this &ldquo;truth&rdquo;, and began his solo play, refusing to form a party, as he threw himself into the never ending battles that lay before him&hellip;

&quot;If you were a girl, we would never have met.&quot;

&quot;Well- to...to be honest with you- I AM a girl-&quot;

Plain when she is a girl, but hot when she is a guy, Choi Ida has been all his live the slave of Mimi, a rich and spoiled girl. When the stress of Ida is to much to bear with it, she goes into the streets looking for fights, disguised as a guy, Yodah, admired and feared by a lot of people. 

But things start to get complicated when Naru, a guy that despite thinking that Ida is a boy, falls in love with her...

&quot;That was the highest fever I never had. Because of those guys.&quot;

When I entered in high school I met the team of &ldquo;tsubasa ga oka D.C&rdquo; Those guy were so problematic but looked like Host! That&rsquo;s what I thought at the beginning&hellip;
&ldquo;&hellip;bet with us Alice, bet with us!&rdquo;
&ldquo;I&rsquo;m going to ridicule you guys!&rdquo;
&ldquo;Let&rsquo;s make a deal. If I lose, you&rsquo;ll have my first kiss&rdquo;
If it&rsquo;s Takeru-kun, I can bet anything. I can give him every &ldquo;first things&rdquo; of my life.

&quot;My inheritance is a company that rents out magic users...what!?&quot;

The extremely scared Iba Itsuki receives his inheritance left to him by his missing father: the Magic User Rental Company Astral. The magic users are rented out to customers to solve problems as requested. 

How will Itsuki deal with the fate of being president when he's never studied mage-craft!?

Wakaba attends the cram school where the popular Toudou-sensei works. The quiet but easily angered Wakaba is a weak person&hellip; and she suddenly confesses! Even though Wakaba thought she wasn&rsquo;t being taken seriously, sensei came to console the broken-hearted Wakaba. They decide on a &lsquo;trial date&rsquo; to see if they&rsquo;re compatible, but sensei is an adult and also popular, and Wakaba is uneasy&hellip;

Contains two extra stories:

Aoi Bokura
Yayoi and Junya are a couple. She was dumped by her ex-boyfriend for whining and being too clingy. So this time she restrained her feelings towards Junya, including her jealousy of other girls.

Love You
Arisugawa Koto, the student president of an all girls high school, meets with the boys' student president to plan a mixer between the two schools. She remembers Taichi from her childhood when she confessed to him, but he calls her &quot;ugly.&quot;

The wanting&hellip;
When Molly transformed herself into a striking redhead, the entire male population of Sydney stood up and took notice! But her new look was for Liam Delaney&rsquo;s benefit alone; she loved him and she wished he felt the same about her.
However it was passion that Molly inspired in Liam! And the fact that he thought she had another male admirer only made him desire her more. Though Molly had never rushed into a physical relationship with any man, perhaps the time had come for seduction? Madeover Molly might be, but deep down inside the was just an inexperienced virgin&hellip;

After the death of a close friend, Tomoe, a former roller skater, joins a famous stunt men troupe, the Green Ship. 
The head of this troupe, Kazusa, becomes her lover, but Tomoe soon discovers that the Green Ship is a sinister crime organisation and that her dear Kazusa is a cold-hearted killer. A difficult struggle begins for Tomoe, not only against the organisation but to get away from Kazusa, who wants his lover back, dead or alive!
The type of story is similar to &ldquo;Romeo and Juliet.&rdquo;

The story centers around Amaya, Iwasawa, and Uehara &mdash; three &quot;annoying, spirited high school girls with zero motivation&quot; &mdash; and their classmates. Their daily life is &quot;what happens when there is nothing happening.&quot;
